import React from 'react';
import './App.css';



const App = () => {
  return (
    <div className='app-wrapper'>
      <header>
        <img src = 'https://static.rfstat.com/renderforest/images/v2/logo-homepage/flat_3.png'/>
      </header>
      <aside>
        <div><a>My profile</a></div>
        <div><a>Messeges</a></div>
        <div><a>News</a></div>
        <div><a>Music</a></div>
      </aside>
      <main>
        Content
      </main>
    </div>
  );
}



export default App;
